{
   "config_cloudlaunch": {
       "instance_user_data": "#!/bin/bash\nsudo apt-get update && sudo apt-get install apt-transport-https ca-certificates curl software-properties-common && curl -fsSL https://download.docker.com/linux/ubuntu/gpg | sudo apt-key add - && sudo apt-key fingerprint 0EBFCD88 && sudo add-apt-repository 'deb [arch=amd64] https://download.docker.com/linux/ubuntu $(lsb_release -cs) stable' && sudo apt-get update && sudo apt-get install docker-ce && docker run -it -p 8913:8913 galaxy/pulsar:dev",
       "instanceType": "m1.large",
       "firewall": [
          {
             "securityGroup": "cloudlaunch-docker",
             "rules": [
                {
                   "protocol": "tcp",
                   "from": "8913",
                   "to": "8913",
                   "cidr": "0.0.0.0/0"
                },
                {
                   "protocol": "tcp",
                   "from": "22",
                   "to": "22",
                   "cidr": "0.0.0.0/0"
                }
             ]
          }
       ]
    }
}
